-- Returns the user permission ('none', 'read' or 'edit') on a document based on
-- the document's share settings.
CREATE OR REPLACE FUNCTION get_user_permission_for_document(document_id uuid, user_id uuid, document documents)
RETURNS TEXT
LANGUAGE plpgsql
SECURITY DEFINER SET search_path = public
AS $$
DECLARE
    document_owner_id uuid;
    document_deleted boolean;
    share_id uuid;
BEGIN
    IF document IS NULL THEN
        -- Select the required information using document_id
        SELECT d.owner_id INTO document_owner_id FROM documents d WHERE id = document_id;

        IF NOT FOUND THEN
            RAISE EXCEPTION 'NOT_FOUND';
            RETURN 'none';
        END IF;

        SELECT d.share_settings INTO share_id FROM documents d WHERE id = document_id;
        SELECT d.deleted INTO document_deleted FROM documents d WHERE id = document_id;
    ELSE
        -- When called inside a policy, the function directly 
        -- receives the document without having to fetch it.
        document_owner_id := document.owner_id;
        document_deleted := document.deleted;
        share_id := document.share_settings;
    END IF;

    -- Check if the document owner_id is equal to auth.uid()
    IF document_owner_id = user_id THEN
        RETURN 'edit';
    END IF;

    IF document_deleted IS TRUE THEN
        RETURN 'none';
    END IF;

    -- Check if the documents share_settings is null
    IF share_id IS NULL THEN
        RETURN 'none';
    END IF;

    IF user_id IS NOT NULL THEN
        -- Check if the auth.uid() is inside share_settings' user_permission
        -- If so, return the permission from the user_permission object
        IF (SELECT user_permissions->>(user_id::text) FROM shares WHERE id = share_id) IS NOT NULL THEN
            RETURN (CASE (SELECT user_permissions->>(user_id::text) FROM shares WHERE id = share_id)
                WHEN 'edit' THEN 'edit'
                WHEN 'read' THEN 'read'
                ELSE 'none'
            END);
        END IF;
    END IF;

    -- Check if the share_settings' anyone_permission is not null
    -- If so, return the anyone_permission
    IF (SELECT anyone_permission FROM shares WHERE id = share_id) IS NOT NULL THEN
        RETURN (SELECT anyone_permission FROM shares WHERE id = share_id);
    END IF;

    -- If none of the above conditions are met, return 'none'
    RETURN 'none';
end; $$;






















